import styled from "styled-components";
import React from 'react'


function  OutNavbar(){
  return (
    <Container>
        <a>
            <img src= { TeslaLogo } alt=""></img>
        </a>
        <Menu>
            <a href="#">Model S</a>
            <a href="#">Model 3</a>
            <a href="#">Model X</a>
            <a href="#">Model Y</a>
        </Menu>
        <RightMenu>
            <a href='#'>Shop</a>
            <a href='#'> Tesla Account</a>
        </RightMenu>
    </Container>
  )
}

export default OutNavbar

const Container = styled.div`
    min-height: 60px;
    position: fixed;
    display: flex;
    align-items: center;
    top: 0;
    left: 0;
    right: 0;
`

const Menu = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
    flex: 1;

    p {
        font-weight: 600;
        text-transform: uppercase;
        padding: 0 10px;
        flex-wrap: no-wrap;
    }
`

const RightMenu = styled.div`

`
